Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Lobster',29000,'값비싼 가재요리를 집에서 알뜰하면서도 근사하게 즐기실 수 있답니다. 고소하고 담백한 마늘 버터를 발라 풍미를 높였습니다.','fish.jpg','1471338031531.jpg',21,7);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Grilled Shrimps',18000,'소금에 재운 새우를 팬에 익히면서 로제 소스를 첨가한 새우 구이입니다.
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Salmon',22000,'연어를 구워 햄버거 형식으로 홍합을 끼워 해산물의 풍미와 연어의 부드러운 육즙을 즐길 수 있는 요리입니다. 크림 소스로 맛을 더합니다.','fish6.jpg','1471338225582.jpg',23,7);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Fish Steak',26000,'육질이 부드럽고 맛있는 고등어살과 매콤함을 더하는 소스 그리고 담백함을 더하는 그라탕식 소스로 맛을 더했습니다. 소스를 섞어먹으면 더욱 맛있습니다.','fish1.jpg','1471338462914.jpg',24,7);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Mussels',23000,'홍합과 다양한 생선으로 매콤한 홍합요리입니다. 생선살과 채소를 갈아 만든 요리로 여러가지 맛을 느낄 수 있습니다. ','fish3.jpg','1471338577026.jpg',25,7);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Baguette',8000,'크림과 바게트 그리고 견과류로 이루어진 디저트입니다.
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'BurryCake',10000,'폭신폭신하고 부드러운 스펀지시트에 휘핑한 생크림과 딸기를 올려 장식한 딸기생크림 케이크입니다. 촉촉한 식감의 시트와 고소한 생크림, 상큼한 과일의 맛이 조화롭게 어우러져 남녀노소에게 인기있는 케이크입니다.','dessert2.jpg','1471338789757.jpg',27,8);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Mango Pudding',9000,'달걀·우유 등을 주재료로 하여 천으로 싸서 쪄서 만드는데, 따뜻한 디저트로 쓰기도 하고 냉각시켜서 차게 쓰기도 한다. 음식의 온도는 정할 수 있습니다.','dessert3.jpg','1471338994285.jpg',28,8);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Pizza',21000,'팬 피자는 팬을 이용하여 굽는 방식인데 두꺼워서 식사 대용으로 적합하고, 신 피자는 크러스트가 얇은 게 특징이며, 스크린 피자는 스크린이라는 기구를 사용하여 굽는 이탈리아 정통피자이다. 도우의 크기는 정할 수 있습니다.','dessert4.jpg','1471339070548.jpg',29,8);
Insert into KHPM.YM_PRODUCT (PRODUCT_NO,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_DESC,PRODUCT_IMG_ORIGIN_PATH,PRODUCT_IMG_SYSTEM_PATH,PRODUCT_ORDER_BY,PRODUCT_CATEGORY_NO) values (YM_PRODUCT_NO_SEQ.NEXTVAL,'Macaron',7000,'마카롱(macaron)은 작고 동그란 모양의 머랭 크러스트(meringue crust) 사이에 잼, 가나슈(ganache), 버터크림 등의 필링(filling)을 채워 만든 프랑스 쿠키이다.','dessert5.jpg','1471339118559.jpg',30,8);
