Insert into KHPM.YM_STORE (STORE_NAME,STORE_TEL,STORE_ADDR,STORE_DESC,STORE_WEEK_BUSINESS_TIME,STORE_WEEKEND_BUSINESS_TIME) values ('KH 레스토랑','1544-9970','서울 강남구 역삼동 823-24','몸과 마음의 건강을 위해 가공된 식자재의 인위적인 맛보다는 자연 그대로의 환경에서 자란 벌레먹고 못생긴 과일이나 채소를 통하여 투박하지만 건강한, 자연 본연의 가치를 실현하고 있습니다. KH 레스토랑은 동서양의 맛과 멋이 담긴 독특한 메뉴를 선보이는 새로운 감각의 레스토랑으로, 각종 스테이크를 비롯해 양갈비, 랍스터 등 세계적인 요리와 함께 프랑스, 미국, 호주, 칠레 등지에서 들여온 150여가지의 최고급 와인을 즐길 수 있습니다. 또한 격조 높은 공간 속에 비즈니스, 가족모임 등을 위한 두 개의 별실도 마련되어 있습니다.','OPEN : 09:00 / BREAK : 14:00~18:00 / CLOSE : 22:00','OPEN : 08:00 / BREAK : 14:00~16:00 / CLOSE : 22:00');
